import React from 'react';

const Hero = () => {
  return (
    <div className="hero bg-secondary text-white text-center py-5" style={{ backgroundImage: 'url(/path/to/your-image.jpg)', backgroundSize: 'cover', backgroundPosition: 'center' }}>
      <div className="container">
        <h1 className="display-4">Capture Your Moment</h1>
        <p className="lead">Professional Videography & Photography for Events, Conferences, and More!</p>
        <a href="/contact" className="btn btn-primary btn-lg">Get In Touch</a>
      </div>
    </div>
  );
};

export default Hero;
